import React from 'react';


  export default function List(props) {
       console.log(props.list);
      const lista = props.list;
      if (lista.length != 0) {
        const listItems = lista.map(
            (element) => {
                return (
                    <ul>
                        <li style={{ color: 'red' }}>
                             User: {element.user}</li>
                        <li> Title: {element.title}</li>
                        <li>Content: {element.content}</li>
                    </ul>
                )
            }
        )
      }
    return (
        <div>
            {listItems}
        </div>
    )
}
